pragma solidity >=0.5.4 <0.6.0;

import "./Charger.sol";
import "./Register.sol";

contract Factory {
    //maybe change it to interfaces
    Register public register;
    address public erc20Address;

    constructor(address _regAddress, address _erc20Addr) public {
        // here store the owner(s) 
        register = Register(_regAddress);
        erc20Address = _erc20Addr;
    }

    function createCharger(string memory _geo, string memory _name, address _owner) public {
        // That's not it, also need to manage owners,
        // balances and etc.
        Charger charger = new Charger(_geo,_name,_owner,erc20Address);

        register.register(address(charger));
    }
}
